import React from 'react';

const books = [
  { title: 'The Atomic Habit', price: 10, image: 'data:image/jpeg;base64,' },
  { title: 'Thhe Power of Habit', price: 15, image: 'data:image/jpeg;base64,' },
  { title: 'Getting Things Done', price: 20, image: 'data:image/jpeg;base64,' },
  { title: 'How to Change', price: 25, image: 'data:image/png;base64,' },
  { title: 'The Culture Code', price: 30, image: 'data:image/jpeg;base64,' },
];

function BookList({ addToCart }) {
  return (
    <div className="book-list">
      {books.map((book, index) => (
        <div key={index} className="book-item">
          <img src={book.image} alt={book.title} className="book-image" />
          <h3 className="book-title">{book.title}</h3>
          <p className="book-price">${book.price}</p>
          <button onClick={() => addToCart(book)} className="add-to-cart-button">
            Add to Cart
          </button>
        </div>
      ))}
    </div>
  );
}

export default BookList;
